        key = sum(ord(char) for char in key)
    encrypted_word = ""
    for char in word:
        if char.isalpha():
            shift = key % 26
            if char.islower():
                encrypted_word += chr((ord(char) - ord('a') + shift) % 26 + ord('a'))
            else:
                encrypted_word += chr((ord(char) - ord('A') + shift) % 26 + ord('A'))
        else:
            encrypted_word += char
    return encrypted_word

